pragma solidity 0.5.6;

import "@klaytn/contracts/token/KIP17/KIP17Full.sol";
import "@openzeppelin/contracts/ownership/Ownable.sol";
import "./utils/Strings.sol";

contract KlaySea is KIP17Full, Ownable {
  using Strings for uint256;

  uint256 private _finalTokenId = 0;
  string private _baseTokenURI = "https://klaysea.alien.moe/api/v1/nfts/";

  // Mapping from token ID to price
  mapping(uint256 => uint256) public tokenIdToPrice;

  event NFTRegistered(address by, uint256 tokenId);
  event NFTBought(address from, address to, uint256 tokenId, uint256 price);

  constructor()
    public
    KIP17Full("KlaySea", "KSEA")
  {}

  function registerNft(address to) external onlyOwner {
    uint256 tokenId = _generateTokenId();
    bytes memory bUrl = abi.encodePacked(_baseTokenURI, tokenId.toString());
    _mint(to, tokenId);
    _setTokenURI(tokenId, string(bUrl));
    tokenIdToPrice[tokenId] = 0;

    emit NFTRegistered(to, tokenId);
  }

  function allowBuy(uint256 tokenId, uint256 price) external {
    require(msg.sender == ownerOf(tokenId), "Not owner of this token");
    require(price > 0, "Price zero");
    tokenIdToPrice[tokenId] = price;
  }

  function disallowBuy(uint256 tokenId) external {
    require(msg.sender == ownerOf(tokenId), "Not owner of this token");
    tokenIdToPrice[tokenId] = 0;
  }

  function buy(uint256 tokenId) public payable {
    // get NFT owner address
    address payable seller = address(uint160(ownerOf(tokenId)));
    // get token price
    uint256 price = tokenIdToPrice[tokenId];
    require(price > 0, "This token is not for sale");
    require(msg.value == price);

    // aprove nft sell
    approve(seller, tokenId);
    setApprovalForAll(msg.sender, true);

    // transfer NFT
    safeTransferFrom(seller, msg.sender, tokenId);

    // transfer KLAY
    seller.transfer(msg.value);

    emit NFTBought(seller, msg.sender, tokenId, msg.value);
  }

  function setBaseTokenURI(string calldata baseTokenURI) external onlyOwner {
    _baseTokenURI = baseTokenURI;
  }

  function tokensOfOwner(address owner)
    external
    view
    returns (uint256[] memory)
  {
    return _tokensOfOwner(owner);
  }

  function ownerTokenLength(address owner) external view returns (uint256) {
    return _tokensOfOwner(owner).length;
  }

  function _generateTokenId() internal returns (uint256) {
    return ++_finalTokenId;
  }
}
